import React from 'react';
import CrudTable from '../components/CrudTable';
import { doctorApi } from '../services/api';

const fields = [
  { key: 'doctorId', label: 'ID', noForm: true },
  { key: 'name', label: 'Name', placeholder: 'Full Name' },
  { key: 'specialization', label: 'Specialization', placeholder: 'e.g. Cardiologist' },
  { key: 'contact', label: 'Contact', placeholder: 'Phone number' },
  { key: 'email', label: 'Email', type: 'email' },
  { key: 'department', label: 'Department' },
];

export default function Doctors() {
  return (
    <div>
      <h1 style={{ fontFamily: "'DM Serif Display', serif", fontSize: 26, marginBottom: 6 }}>Doctors</h1>
      <p style={{ color: 'var(--text-light)', marginBottom: 24, fontSize: 14 }}>Manage doctor profiles and specializations</p>
      <CrudTable title="Doctors" fields={fields} api={doctorApi} idField="doctorId" />
    </div>
  );
}
